import React,{ PureComponent } from 'react';
import {Link } from 'react-router-dom';
import { Icon ,Col,Row} from 'antd';
import {
    DetailDemo,
    BackTitle
} from './style';
class Detail extends PureComponent{
    render(){
        return (
            <DetailDemo>
                <BackTitle>
                    <Row>
                        <Col span={1} offset={1}>
                            <Icon style={{ fontSize: '20px', color: '#08c' }} type="arrow-left" />
                        </Col>
                        <Col>
                            <Icon span={1} style={{ fontSize: '20px', color: '#08c' }} type="arrow-left" />
                        </Col>
                    </Row>
                </BackTitle>
            </DetailDemo>
        )
    }
    componentDidMount(){
        window.scrollTo(0,0)
      }
}

export default Detail;
